import React from "react";
import axios from "axios";
import { useEffect, useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import { Button, Grid, Typography } from "@mui/material";
import DepTable from "../Components/DepTable";
import { useSelector } from "react-redux";
const DepartmentPage = () => {
  let token = sessionStorage["token"];
  const storeData = useSelector();
  const navigate = useNavigate();
  const [deps, setDeps] = useState([]);
  const [emps, setEmps] = useState([]);

  useEffect(async () => {
    let resp = await axios.get("http://127.0.0.1:5000/getAllFactory");
    let all_db_data = resp.data;
    let deps = all_db_data.departments;
    let emp = all_db_data.employees;
    setDeps(deps);
    console.log(deps);
    setEmps(emp);
  }, []);
  return <div>DepartmentPage</div>;
};

export default DepartmentPage;
